[[File:Tribesman chathead.png|left]]
'''Tribesmen''' are people that inhabit the jungles of [[Karamja]]. They can be found in various areas around Karamja, notably near [[Brimhaven]] around a cauldron and in the [[Tai Bwo Wannai]] village. They may also be encountered during the [[Tai Bwo Wannai Cleanup]] [[Minigames|minigame]] when players attempt to cut the jungle bushes. Though their attacks have a fairly low max hit, any successful hit from them will inflict a potent [[poison]], dealing 11 poison damage per hit. As a result, players are advised to bring [[antipoison]] when travelling through their areas.

They are not [[Aggressiveness|aggressive]] toward players with a [[Combat level]] of 65 or higher. This is because, as with many aggressive NPCs, they are not aggressive toward players with a Combat level more than twice their own.

